define({"topics" : [{"title":"Specifying a report period","shortdesc":"\n                  <p class=\"shortdesc\">When specifying the start date and time and end date and time of the time period to         cover in a report, you need to\n                     take into account the time zone where the system is         installed, and how long data is stored in the Activity Journal.\n                  </p>\n               ","href":"specifying_a_report_period.html","attributes": {"data-id":"specifying_a_report_period",},"menu": {"hasChildren":false,},"tocID":"specifying_a_report_period-d66e3182","next":"specifying_a_report_period-d66e3182",},{"title":"Filtering by user resource, and policy","shortdesc":"\n                  <p class=\"shortdesc\">When filtering policy activity data by user, resource, or policy, you can use either,         or both, of the following methods.</p>\n               ","href":"filtering_by_user_resource__and_policy.html","attributes": {"data-id":"filtering_by_user_resource__and_policy",},"menu": {"hasChildren":false,},"tocID":"filtering_by_user_resource__and_policy-d66e3215","next":"filtering_by_user_resource__and_policy-d66e3215",},{"title":"Filtering by action","shortdesc":"\n                  <p class=\"shortdesc\">You can filter the policy activity data by user actions, such as create, run, or         rename.</p>\n               ","href":"filtering_by_action.html","attributes": {"data-id":"filtering_by_action",},"menu": {"hasChildren":false,},"tocID":"filtering_by_action-d66e3257","topics":[]}]});